import './App.css';
import React from "react";
import { Link, Route, Switch, BrowserRouter as Router } from "react-router-dom";
import Home from "./Home";
// import About from "./About";
// import NotFound from "./NotFound";

function App() {
  this.state ={
    userid: 'User',
    solved: '2',
    notsolved: '1',
    imgurl: '1'

  }
  return (
    <Router>
      <header className="flex-container">
        <Link to="./" refresh="true">
          <a onClick={() => {window.location.href="./"}} className="Ask-for-Question">Ask Yourself</a>
        </Link>
        <Link to="./">
          <div className="nav">
            <a onClick={() => {window.location.href="./"}}>나의 테스트</a>
          </div>
        </Link>
        <Link to="/group">
          <div className="nav">
            나의 그룹
          </div>
        </Link>
        <Link to="/find">
          <div className="nav">
            찾아보기
          </div>
        </Link>
      </header>
      <main>
        <Switch>
          <Route exact path="/" component={Home} 
          componentDidMount={function() {
            this.props.getUser(this.props.auth.user).
            then(user => this.setState({ 
            username: user.id, email: user.email, username: user.username }))
          }}
            />
          {/* <Route path="/about" component={About} />
          <Route component={NotFound} /> */}
        </Switch>
      </main>
    </Router>
  );
}

export default App;
